import React from "react";
import { Navbar, Nav } from "react-bootstrap";
//import { Route } from "react-router-dom";
import { Link } from "react-router-dom"; //adds styling to the link
import Logout from "./registrations/Logout";

const NavBar = ({ currentAccount }) => {
  return (
    <Navbar
      bg="light"
      expand="sm"
      style={{ backgroundColor: "#071740", position: "sticky" }}
      sticky-top
    >
      <Navbar.Brand href="/"></Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        {currentAccount ? (
          <button class="btn btn-outline-primary">
            <Link to="/logout">Logout</Link>
          </button>
        ) : (
          <button class="btn btn-outline-primary">
            <Link to="/api/v1/signup">Signup</Link>
          </button>
        )}
      </Navbar.Collapse>
    </Navbar>
  );
};

export default NavBar;
